import React from "react";

const WorkProcess = () => {
  return (
    <section className="work-process">
      <h2>How it works?</h2>
      <div className="process-step">
        <p>1. Escolha o melhor profissional para si</p>
      </div>
      <div className="process-step">
        <p>2. Escolha os horários que mais lhe convêm</p>
      </div>
      <div className="process-step">
        <p>3. Contacte o terapeuta para mais informações</p>
      </div>
    </section>
  );
};

export default WorkProcess;
